import React from 'react'
import { FaPlusCircle,FaSmile } from 'react-icons/fa'
function CreateAd(props){
  return(
    <FaPlusCircle height="100px"/>
  )
}

function MyAds(props){
  return(
      <FaSmile />
  )
}
class DashBoard extends React.Component{
    constructor(props){
        super(props)
    }
    render(){
        return (
        <div className="container d-flex align-items-center" style={{height:"100vh",width:"100vw"}}>
        <div className="shadow d-flex justify-content-center align-items-center" style={{backgroundColor:"rgb(71,64,95,0.9)",height:"90vh",width:"90vw"}}>
        <CreateAd />
        <MyAds />
        </div>
        </div>
        )
    }
}

export default DashBoard;
